import "./CircleSelector.css"
export default function CircleSelector(props) {
  return (
    <div className="CircleSelector">
      <button onClick={props.handleClick} name="one">{props.one ? "Circle One Selected" : "Select Circle 1"}</button>
      <button onClick={props.handleClick} name="two">Select Circle 2</button>
      <button onClick={props.handleClick} name="three">Select Circle 3</button>
      <button onClick={props.handleClick} name="four">Select Circle 4</button>
    </div>
  );
}
